import './App.css';

import "./sass/app.scss";

class App extends Component {
  render() {
    return 
    <div className="app-container">
      <div className="main-container">
        <div className="top-section"></div>
        <div className="bottom-section"></div>
      </div>

    </div>
  }
}

export default App;
